// Popup menu functions
function showPopupMenu() {
    overlay.style.display = 'block'; // Show the overlay
    overlay.style.opacity = '0';
    overlay.style.transition = 'opacity 0.3s ease';

    setTimeout(() => {
        overlay.style.opacity = '1';
    }, 10);

    popupMenu.style.display = 'flex';
    popupMenu.style.flexDirection = 'row';
    popupMenu.style.flexWrap = 'nowrap';
    popupMenu.style.justifyContent = 'center';
    popupMenu.style.alignItems = 'center';
    popupMenu.style.left = '50%';
    popupMenu.style.top = '50%';
    popupMenu.style.transform = 'translate(-50%, -50%) scale(0.95)';
    popupMenu.style.transition = 'all 0.3s ease';
    popupMenu.style.zIndex = '10000'; // Ensure popup is above overlay

    setTimeout(() => {
        popupMenu.style.opacity = '1';
        popupMenu.style.transform = 'translate(-50%, -50%) scale(1)';
    }, 10);
}

// Update hidePopupMenu function
function hidePopupMenu() {
    overlay.style.opacity = '0';
    popupMenu.style.opacity = '0';
    popupMenu.style.transform = 'translate(-50%, -50%) scale(0.95)';

    setTimeout(() => {
        overlay.style.display = 'none';
        popupMenu.style.display = 'none';
    }, 300); // Match the transition duration
}

