// Add click handlers for the action buttons
async function updateActionDisplayContent(action, content, currentTitle, currentUrl, formattedText) {
    try {
        // Load Google Docs functions dynamically
        const actionButtons = content.querySelectorAll('.action-button');
        actionButtons.forEach(button => {
            button.addEventListener('click', async () => {
                const buttonAction = button.dataset.action.toLowerCase(); // Ensure lowercase to match cases

                // Show loading state
                const originalContent = button.innerHTML;
                button.innerHTML = `<div class="loading-spinner" style="width: 20px; height: 20px;"></div>`;
                button.disabled = true;

                try {
                    // Format the text with metadata
                    const messageData = {
                        action: `saveTo${buttonAction.charAt(0).toUpperCase() + buttonAction.slice(1)}`,
                        data: {
                            text: formattedText,
                            title: currentTitle,
                            url: currentUrl,
                            timestamp: new Date().toISOString()
                        }
                    };

                    // Send message and wait for response
                    const response = await chrome.runtime.sendMessage(messageData);

                    if (!response || response.error) {
                        throw new Error(response?.error || 'Failed to save');
                    }

                    // Show success
                    button.innerHTML = `<span style="color: #4caf50;"> Saved</span>`;

                    // New functionality: Send summary to Google Docs
                    if (buttonAction === 'docs') {
                        createGoogleDoc(currentTitle, formattedText); // Ensure this function is defined
                    }

                } catch (error) {
                    console.error(`Error saving to ${buttonAction}:`, error);
                    button.innerHTML = `<span style="color: #f44336;">Failed</span>`;
                } finally {
                    // Reset button after delay
                    setTimeout(() => {
                        button.innerHTML = originalContent;
                        button.disabled = false;
                    }, 6000);
                }
            });
        });

    } catch (error) {
        console.error('Error in updateActionDisplayContent:', error);
        const errorMessage = error.message.includes('Early Preview Program')
            ? `<div style="padding: 20px; text-align: center;">
                   <div style="color: #d32f2f; margin-bottom: 15px;">
                       ${error.message}
                   </div>
                   <a href="https://developer.chrome.com/docs/ai/early-access" 
                      target="_blank" 
                      style="display: inline-block; 
                             padding: 10px 20px; 
                             background-color: #1976d2; 
                             color: white; 
                             text-decoration: none; 
                             border-radius: 4px;
                             margin-top: 10px;">
                       Join Early Preview Program
                   </a>
               </div>`
            : `<div style="padding: 20px; text-align: center;">
                   <div style="color: #d32f2f; margin-bottom: 15px;">
                       ${error.message}
                   </div>
               </div>`;

        content.innerHTML = errorMessage;
    }
}

// Update the handleDisplayOnScreen function to prevent auto-closing
function handleDisplayOnScreen(action, selectedText) {
    // Create container
    const displayContainer = document.createElement('div');
    displayContainer.style.position = 'fixed';
    displayContainer.style.left = '50%';
    displayContainer.style.top = '50%';
    displayContainer.style.transform = 'translate(-50%, -50%)';
    displayContainer.style.backgroundColor = 'white';
    displayContainer.style.padding = '20px';
    displayContainer.style.borderRadius = '8px';
    displayContainer.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
    displayContainer.style.zIndex = '10000';
    displayContainer.style.minWidth = '500px';
    displayContainer.style.maxWidth = '600px';
    displayContainer.style.opacity = '0';
    displayContainer.style.transition = 'opacity 0.3s ease';

    // Create header
    const header = document.createElement('div');
    header.style.display = 'flex';
    header.style.justifyContent = 'space-between';
    header.style.alignItems = 'center';
    header.style.marginBottom = '16px';

    const title = document.createElement('h3');
    title.textContent = action;
    title.style.margin = '0';
    title.style.color = '#333';

    const closeButton = document.createElement('button');
    closeButton.innerHTML = '';
    closeButton.style.border = 'none';
    closeButton.style.background = 'none';
    closeButton.style.fontSize = '24px';
    closeButton.style.cursor = 'pointer';
    closeButton.style.padding = '4px';


    const content = document.createElement('div');
    content.style.position = 'relative';
    content.style.minHeight = '100px';
    content.style.padding = '16px';
    content.style.backgroundColor = '#f5f5f5';
    content.style.borderRadius = '8px';

    // Assemble the components
    header.appendChild(title);
    header.appendChild(closeButton);
    displayContainer.appendChild(header);
    displayContainer.appendChild(content);
    document.body.appendChild(displayContainer);

    // Show the container
    requestAnimationFrame(() => {
        displayContainer.style.opacity = '1';
    });

    // Create overlay to prevent clicks outside
    const overlay = document.createElement('div');
    overlay.style.position = 'fixed';
    overlay.style.top = '0';
    overlay.style.left = '0';
    overlay.style.width = '100%';
    overlay.style.height = '100%';
    overlay.style.backgroundColor = 'rgba(0, 0, 0, 0.5)';
    overlay.style.zIndex = '9999';
    document.body.appendChild(overlay);

    // Close function
    const closeDisplay = () => {
        displayContainer.style.opacity = '0';
        overlay.style.opacity = '0';
        setTimeout(() => {
            displayContainer.remove();
            overlay.remove();
        }, 300);
    };

    // Event listeners
    closeButton.onclick = (e) => {
        e.stopPropagation();
        closeDisplay();
    };

    // Only close when clicking the overlay, not the content
    overlay.onclick = (e) => {
        if (e.target === overlay) {
            closeDisplay();
        }
    };

    // Prevent closing when clicking inside the container
    displayContainer.onclick = (e) => {
        e.stopPropagation();
    };

    // Start the content update
    updateDisplayContent(content, action, selectedText);
}

async function handleInsights(text) {
    try {
        const validatedText = validateInput(text);

        // Using Chrome's Prompt API to generate insights
        const prompt = {
            type: 'ANALYZE',
            text: validatedText,
            instructions: 'Analyze this text and provide key insights, main themes, and important points.'
        };

        const insights = await chrome.runtime.sendMessage({
            type: 'GET_INSIGHTS',
            prompt: prompt
        });

        return insights;
    } catch (error) {
        console.error('Insights error:', error);
        throw new Error('Failed to generate insights. Please try again later.');
    }
}

async function handleTranslate(text, targetLanguage) {
    try {
        const validatedText = validateInput(text);

        // Using Chrome's Translation API
        const translation = await chrome.runtime.sendMessage({
            type: 'TRANSLATE',
            text: validatedText,
            targetLanguage: targetLanguage
        });

        return translation;
    } catch (error) {
        console.error('Translation error:', error);
        throw new Error('Failed to translate text. Please try again later.');
    }
}

