async function handleIconClick(action) {
    const selectedText = getSelectedText();
    console.log('handleIconClick called with action:', action);

    if (action === 'Summarize') {
        console.log('Selected text for summarization:', selectedText);
        const lastAction = currentAction || 'Summarize';
        // Add this code here
        try {
            const authStatus = await chrome.runtime.sendMessage({ action: 'checkAuthStatus' });
            if (authStatus?.isAuthenticated) {
                // Store the summary
                await chrome.runtime.sendMessage({
                    action: 'storeSummary',
                    data: {
                        title: document.title || 'Untitled Summary',
                        summary: selectedText, // The text to be summarized
                        createdAt: new Date().toISOString()
                    }
                });
                console.log('Summary stored successfully');
            } else {
                console.log('User not authenticated');
            }
        } catch (error) {
            console.error('Error storing summary:', error);
        }
        handleDisplayOnScreen(lastAction, selectedText);
    } else {
        switch (action) {
            case 'Keep':
                chrome.runtime.sendMessage({
                    action: 'saveToKeep',
                    text: selectedText
                });
                break;
            case 'Translate':
            case 'Insights':
                currentAction = action;
                handleDisplayOnScreen(action, selectedText);
                break;
        }
    }
}